import ReactDOM from "react-dom/client";
import User from "./User";
import './index.css'


ReactDOM.createRoot(document.getElementById("root")).render(
    <StrictMode>
     <>
     < User name='Hossein' age={21} job = 'front Developer'/>
     < User name='AmirHossein' age={22} job = 'Tra'/>
     < User name='AmirMohammad' age={17} job = 'machi'/>
     </> 
    </StrictMode>
  );
